import logo from './images/tinder_logo_white.png'
import colorLogo from './images/tinder_logo.png'

const Nav = () => {

    const minimal = true

    return (
        <nav>
            <div className="logo-container">
                <img className="logo" src={minimal ? colorLogo : logo}/>
            </div>
        </nav>
    )
}

export default Nav
